import React from 'react';

const SpotifyEmbed = (props) => {
  // Extract the Spotify ID from the URI
  const trackID = props.trackURI.split(':').pop();

  return (
    <div>
      <div className="container">
      <iframe title={trackURI} style={{"border-radius":12}} src={`https://open.spotify.com/embed/track/${trackID}?utm_source=generator`} width="50%" height="252" allowfullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy"></iframe>
      </div>
    </div>
  );
};

export default SpotifyEmbed;
